PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE users (
	id INTEGER NOT NULL, 
	name VARCHAR(100) NOT NULL, 
	email VARCHAR(255) NOT NULL, 
	password_hash VARCHAR(255) NOT NULL, 
	created_at DATETIME DEFAULT (CURRENT_TIMESTAMP), 
	PRIMARY KEY (id)
);
CREATE TABLE transactions (
	id INTEGER NOT NULL, 
	user_id INTEGER NOT NULL, 
	amount FLOAT NOT NULL, 
	description VARCHAR(255) NOT NULL, 
	category VARCHAR(100) NOT NULL, 
	type VARCHAR(20) NOT NULL, 
	date DATETIME NOT NULL, 
	created_at DATETIME DEFAULT (CURRENT_TIMESTAMP), 
	PRIMARY KEY (id), 
	FOREIGN KEY(user_id) REFERENCES users (id)
);
CREATE TABLE budgets (
	id INTEGER NOT NULL, 
	user_id INTEGER NOT NULL, 
	category VARCHAR(100) NOT NULL, 
	"limit" FLOAT NOT NULL, 
	month VARCHAR(7) NOT NULL, 
	created_at DATETIME DEFAULT (CURRENT_TIMESTAMP), 
	PRIMARY KEY (id), 
	FOREIGN KEY(user_id) REFERENCES users (id)
);
CREATE TABLE groups (
	id INTEGER NOT NULL, 
	name VARCHAR(100) NOT NULL, 
	description TEXT, 
	created_by INTEGER NOT NULL, 
	created_at DATETIME DEFAULT (CURRENT_TIMESTAMP), 
	PRIMARY KEY (id), 
	FOREIGN KEY(created_by) REFERENCES users (id)
);
CREATE TABLE group_members (
	id INTEGER NOT NULL, 
	group_id INTEGER NOT NULL, 
	user_id INTEGER NOT NULL, 
	joined_at DATETIME DEFAULT (CURRENT_TIMESTAMP), 
	PRIMARY KEY (id), 
	FOREIGN KEY(group_id) REFERENCES groups (id), 
	FOREIGN KEY(user_id) REFERENCES users (id)
);
CREATE TABLE group_expenses (
	id INTEGER NOT NULL, 
	group_id INTEGER NOT NULL, 
	paid_by_user_id INTEGER NOT NULL, 
	amount FLOAT NOT NULL, 
	description VARCHAR(255) NOT NULL, 
	category VARCHAR(100) NOT NULL, 
	date DATETIME NOT NULL, 
	splits JSON NOT NULL, 
	created_at DATETIME DEFAULT (CURRENT_TIMESTAMP), 
	PRIMARY KEY (id), 
	FOREIGN KEY(group_id) REFERENCES groups (id), 
	FOREIGN KEY(paid_by_user_id) REFERENCES users (id)
);
CREATE TABLE settlements (
	id INTEGER NOT NULL, 
	group_id INTEGER NOT NULL, 
	from_user_id INTEGER NOT NULL, 
	to_user_id INTEGER NOT NULL, 
	amount FLOAT NOT NULL, 
	description VARCHAR(255), 
	settled_at DATETIME DEFAULT (CURRENT_TIMESTAMP), 
	PRIMARY KEY (id), 
	FOREIGN KEY(group_id) REFERENCES groups (id), 
	FOREIGN KEY(from_user_id) REFERENCES users (id), 
	FOREIGN KEY(to_user_id) REFERENCES users (id)
);
CREATE INDEX ix_users_id ON users (id);
CREATE UNIQUE INDEX ix_users_email ON users (email);
CREATE INDEX ix_transactions_id ON transactions (id);
CREATE INDEX ix_budgets_id ON budgets (id);
CREATE INDEX ix_groups_id ON groups (id);
CREATE INDEX ix_group_members_id ON group_members (id);
CREATE INDEX ix_group_expenses_id ON group_expenses (id);
CREATE INDEX ix_settlements_id ON settlements (id);
COMMIT;
